import React, { Component } from "react";
import { Card } from "semantic-ui-react";

const arrayOfCards = [];

class MatchHistory extends Component {
  componentDidMount(arrayOfCards) {
    fetch(`http://localhost:3001//api/v1/games`)
      .then(r => r.json())
      .then(console.log);
  }
  render() {
    return arrayOfCards;
  }
}
export default MatchHistory;
